import React, { useState } from 'react';
import { Settings, AlertTriangle, Car, Heart, Users, Shield, Zap, Play, Pause, RefreshCw } from 'lucide-react';

const ControlPanel = ({ currentScenario, setCurrentScenario, manualOverride, setManualOverride }) => {
  const [isSimulationRunning, setIsSimulationRunning] = useState(true);
  const scenarios = [
    {
      id: 'normal',
      label: 'Normal',
      description: 'Standard traffic flow',
      icon: Car,
      color: 'text-success-600'
    },
    {
      id: 'heavy',
      label: 'Heavy',
      description: 'Rush hour traffic',
      icon: Users,
      color: 'text-warning-600'
    },
    {
      id: 'accident',
      label: 'Accident',
      description: 'Emergency incident',
      icon: AlertTriangle,
      color: 'text-danger-600'
    },
    {
      id: 'ambulance',
      label: 'Ambulance',
      description: 'Emergency vehicle priority',
      icon: Heart,
      color: 'text-danger-600'
    }
  ];

  return (
    <div className="space-y-6">
      {/* Control Panel Header */}
      <div className="glass-card p-6 cyber-border">
        <div className="flex items-center justify-between mb-6">
          <div className="flex items-center space-x-3">
            <div className="w-8 h-8 bg-gradient-to-br from-neon-400 to-cyan-400 flex items-center justify-center">
              <Settings className="w-5 h-5 text-void-900" />
            </div>
            <div>
              <h2 className="text-xl font-semibold text-white font-display">Control Panel</h2>
              <p className="text-cyan-300/70 text-sm">System Management</p>
            </div>
          </div>
          <div className="flex items-center space-x-2">
            <Shield className="w-5 h-5 text-neon-400" />
            <span className="text-xs font-mono text-neon-400">SECURE</span>
          </div>
        </div>
        {/* Simulation Controls */}
        <div className="mb-8">
          <h3 className="text-sm font-semibold text-cyan-300 mb-4 tracking-wide">SIMULATION CONTROL</h3>
          <div className="flex items-center space-x-4">
            <button
              onClick={() => setIsSimulationRunning(!isSimulationRunning)}
              className={`flex items-center space-x-2 px-4 py-2 font-mono text-sm transition-all duration-300 cyber-border ${
                isSimulationRunning 
                  ? 'bg-neon-500/20 text-neon-400 hover:bg-neon-500/30' 
                  : 'bg-void-700/50 text-void-300 hover:bg-void-700/70'
              }`}
            >
              {isSimulationRunning ? <Pause className="w-4 h-4" /> : <Play className="w-4 h-4" />}
              <span>{isSimulationRunning ? 'PAUSE' : 'START'}</span>
            </button>
            <button className="flex items-center space-x-2 px-4 py-2 bg-cyber-500/20 text-cyber-400 hover:bg-cyber-500/30 font-mono text-sm transition-all duration-300 cyber-border">
              <RefreshCw className="w-4 h-4" />
              <span>RESET</span>
            </button>
          </div>
        </div>

        {/* Manual Override */}
        <div className="mb-8">
          <div className="flex items-center justify-between mb-4">
            <h3 className="text-sm font-semibold text-cyan-300 tracking-wide">MANUAL OVERRIDE</h3>
            <div className="flex items-center space-x-3">
              <span className="text-xs font-mono text-void-400">AI MODE</span>
              <label className="relative inline-flex items-center cursor-pointer">
                <input
                  type="checkbox"
                  checked={manualOverride}
                  onChange={(e) => setManualOverride(e.target.checked)}
                  className="sr-only peer"
                />
                <div className="w-11 h-6 bg-void-700 peer-focus:outline-none peer-checked:after:translate-x-full peer-checked:after:border-white after:content-[''] after:absolute after:top-[2px] after:left-[2px] after:bg-white after:border-gray-300 after:border after:h-5 after:w-5 after:transition-all peer-checked:bg-neon-500"></div>
              </label>
              <span className="text-xs font-mono text-warning-400">MANUAL</span>
            </div>
          </div>
          {manualOverride && (
            <div className="p-4 bg-warning-500/10 border border-warning-500/30 animate-fade-in">
              <div className="flex items-center space-x-2 text-warning-400">
                <AlertTriangle className="w-4 h-4" />
                <span className="text-sm font-mono">Manual override active</span>
              </div>
            </div>
          )}
        </div>
      </div>

      {/* Scenario Selection */}
      <div className="glass-card p-6 cyber-border">
        <h3 className="text-sm font-semibold text-cyan-300 mb-6 tracking-wide">TRAFFIC SCENARIOS</h3>
        <div className="grid grid-cols-2 gap-4">
          {scenarios.map((scenario) => {
            const Icon = scenario.icon;
            const isActive = currentScenario === scenario.id;
            return (
              <button
                key={scenario.id}
                onClick={() => setCurrentScenario(scenario.id)}
                className={`group relative p-4 text-left transition-all duration-300 cyber-border ${
                  isActive
                    ? 'bg-neon-500/20 border-neon-500/50'
                    : 'bg-void-800/30 hover:bg-void-700/50'
                }`}
              >
                <div className="flex items-center space-x-3 mb-2">
                  <Icon className={`w-5 h-5 ${
                    isActive ? 'text-neon-400' : 'text-void-400 group-hover:text-void-300'
                  }`} />
                  <span className={`font-semibold ${
                    isActive ? 'text-neon-400' : 'text-white'
                  }`}>
                    {scenario.label}
                  </span>
                </div>
                <p className={`text-xs ${
                  isActive ? 'text-cyan-300/80' : 'text-void-400'
                }`}>
                  {scenario.description}
                </p>
                {isActive && (
                  <div className="absolute top-2 right-2">
                    <Zap className="w-4 h-4 text-neon-400 animate-pulse" />
                  </div>
                )}
              </button>
            );
          })}
        </div>
      </div>

      {/* System Metrics */}
      <div className="glass-card p-6 cyber-border">
        <h3 className="text-sm font-semibold text-cyan-300 mb-6 tracking-wide">SYSTEM METRICS</h3>
        <div className="space-y-4">
          <div className="flex items-center justify-between">
            <span className="text-sm text-void-300 font-mono">AI Confidence</span>
            <div className="flex items-center space-x-2">
              <span className="text-sm font-bold text-neon-400 font-mono">94%</span>
              <div className="w-2 h-2 bg-neon-400 animate-pulse"></div>
            </div>
          </div>
          <div className="flex items-center justify-between">
            <span className="text-sm text-void-300 font-mono">Response Time</span>
            <div className="flex items-center space-x-2">
              <span className="text-sm font-bold text-cyber-400 font-mono">0.3s</span>
              <div className="w-2 h-2 bg-cyber-400 animate-pulse"></div>
            </div>
          </div>
          <div className="flex items-center justify-between">
            <span className="text-sm text-void-300 font-mono">Active Sensors</span>
            <div className="flex items-center space-x-2">
              <span className="text-sm font-bold text-neon-400 font-mono">48/50</span>
              <div className="w-2 h-2 bg-neon-400 animate-pulse"></div>
            </div>
          </div>
          <div className="flex items-center justify-between">
            <span className="text-sm text-void-300 font-mono">Uptime</span>
            <div className="flex items-center space-x-2">
              <span className="text-sm font-bold text-cyan-400 font-mono">127h</span>
              <div className="w-2 h-2 bg-cyan-400 animate-pulse"></div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default ControlPanel;
